import React, { Component, useState } from 'react';

import {
    XYPlot,
    XAxis,
    YAxis,
    VerticalGridLines,
    HorizontalGridLines,
    LineMarkSeries,
    HexbinSeries,
    ChartLabel,
    VerticalBarSeries,
    LineSeries,
    Highlight,
    HighlightArea,
    VerticalRectSeries,
    Treemap,
    Sunburst,
    AreaSeries,
    DiscreteColorLegend,
} from 'react-vis';

export function DonationsChart() {
    return (
        <XYPlot width={300} height={300}>
            <VerticalGridLines />
            <HorizontalGridLines />
            <XAxis
                style={{
                    strokeWidth: '3px',
                    line: { stroke: 'red' },
                    ticks: { stroke: 'green' },
                    title: { textTransform: 'uppercase' },
                    text: {
                        stroke: 'none',
                        fill: 'blue',
                        fontWeight: 600,
                    },
                }}
            />
            <YAxis
                style={{
                    strokeWidth: '3px',
                    line: { stroke: 'purple' },
                    ticks: { stroke: 'orange' },
                    title: { textTransform: 'capitalize' },
                    text: {
                        stroke: 'none',
                        fill: 'rgb(70%, 80%, 54%)',
                        fontWeight: 600,
                    },
                }}
            />
            <LineMarkSeries
                className="linemark-series-example"
                style={{
                    strokeWidth: '3px',
                }}
                lineStyle={{ stroke: 'red' }}
                markStyle={{ stroke: 'blue' }}
                data={[
                    { x: 1, y: 10 },
                    { x: 2, y: 5 },
                    { x: 3, y: 15 },
                ]}
                strokeWidth={3}
            />
            <LineMarkSeries
                className="linemark-series-example-2"
                curve={'curveMonotoneX'}
                data={[
                    { x: 1, y: 11 },
                    { x: 1.5, y: 29 },
                    { x: 3, y: 7 },
                ]}
            />
        </XYPlot>
    );
}
